column3:
Размеры: диаметр 6,2 см, ширина с ручкой 8,2 см, высота 5,3 см, материал: фаянс, вес: 125г
Шрифт: Greatly Font Duo;
Принт: 
Вместо двух мостов, аттракцион Самоцветы, вместо St. Petersburg лого Сочи-Парк, по кругу надпись «Закружись в сиянии самоцветов», цифры под логотипом: 2014;

Размер: диаметр 9 см, высота 10 см; материал: металл; 
Полная запечатка; обыграть Жар-Птицу в стиле Дымковской игрушки;
Упаковка: Дымковский орнамент, полная запечатка

Размер: диаметр 9 см, высота 10 см; материал: металл; 
Орнамент пустить по верхнему краю кружки;
Принт щита размещаем слева от ручки, сверху и снизу щита, делаем надпись. 
Упаковка: Меч размещаем на упаковке с лицевой стороны.
Орнамент (красная полоса) размещаем по периметру коробки.
